import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navBar";
import AdvisorInfoModal from "./components/advisorInfoModal";
import {
  StudentHomePage,
  CourseListPage,
  AdvisorInfoModal1,
  LogOut,
} from "./pages";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" component={StudentHomePage} />
        <Route exact path="/CourseList" component={CourseListPage} />
        <Route exact path="/advisorInfoModal" component={AdvisorInfoModal1} />
        <Route exact path="/logout" component={LogOut} />
      </Switch>
    </div>
  );
}

export default App;
